    engine: AbstractEngine[],
    doors: AbstractDoor[],
    windows: AbstractWindow[],
    tires: AbstractTire[],
    rims: AbstractRims[],
}
const NormalCar = (props: AbstractCarProps) => {
    return (
        <div>
            <div className='header'>
                <h1>Stel je Auto samen:</h1>
            </div>
            <h3>Klik op de eigenschappen om ze te kiezen</h3>
            {
                props.engine.map(car => {
                    return (
                        <h3 key={car.id}>Moter:<br></br> {car.EngineType}</h3>
                    )
                })
            }
            {
                props.doors.map(door => {
                    return (
                        <h3 key={door.id}>Kleur deuren:<br></br> {door.color}</h3>
                    )
                })
            }
            {
                props.windows.map(window => {
                    return (
                        <h3 key={window.id}>Kleur ramen:<br></br>{window.color}</h3>
                    )
                })
            }
            {

            }
        </div>
    )
}

export default NormalCar
